import React from 'react';
import searchIcon from '../img/serch_header.svg';
import userIcon from './svg/User.svg';
import heartIcon from './svg/Heart.svg';
import cartIcon from './svg/Cart.svg';

const Header = () => {
    return (
        <div className="header_pc">
            <img src="https://firebasestorage.googleapis.com/v0/b/swiftreplus.appspot.com/o/Compan_data%2Fcompany_logo%2Flogo_pc_header.svg?alt=media&token=6f9eb882-96ca-4067-bdc2-9a16b0318d13" alt="Logo" className="w-44 cursor-pointer" onClick={() => window.location.href='home.html'} />
            <img src="https://firebasestorage.googleapis.com/v0/b/swiftreplus.appspot.com/o/Compan_data%2Fcompany_logo%2Fcvtalog_button.svg?alt=media&token=20feac49-fcb1-4550-aa59-d7db9c08adac" alt="Catalog" className="w-36 cursor-pointer" onClick={() => window.location.href='catalog.html'} />
            <div className="header_pc_vision">
                <input className="sgerch_pc" type="text" placeholder="Поиск товара" />
                <img src=""alt="Search" className="cursor-pointer" />
            </div>
            <div className="blocs_header_pc">
                <div className="bloc_header_pc" onClick={() => window.location.href='personal_area_setting.html'}>
                    <img src={userIcon} alt="User" />
                    <a className="text-xs text-gray-500 cursor-pointer" onClick={() => window.location.href='personal_area_setting.html'}>Кабинет</a>
                </div>
                <div className="bloc_header_pc" onClick={() => window.location.href='favorites.html'}>
                    <img src={heartIcon} alt="Heart" />
                    <a className="text-xs text-gray-500 cursor-pointer" onClick={() => window.location.href='favorites.html'}>Избранное</a>
                </div>
                <div className="bloc_header_pc" onClick={() => window.location.href='cart.html'}>
                    <img src={cartIcon} alt="Cart" />
                    <a className="text-xs text-gray-500 cursor-pointer" onClick={() => window.location.href='cart.html'}>Корзина</a>
                </div>
            </div>
        </div>
    );
};

export default Header;
